package sampleprograms;

public class Swap {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=20;
		int b=25;
		System.out.println("Before swap");
		System.out.println("Value "+a);
		System.out.println("Value "+b);
		int temp=a;
		a=b;
		b=temp;
		System.out.println("After swap");
		System.out.println("Value "+a);
		System.out.println("Value "+b);
		
	}

}
